    let ViewModel = function(data) {
      const self = this;
      const numOptions = {style: 'decimal', pattern: '#,##0.####'};

      const numberConverter =
      oj.Validation.converterFactory("number").createConverter(numOptions);
      this.formatNum = data => numberConverter.format(data);
      this.attributes = ko.observableArray();
      this.groups = ko.observableArray();
      function getColumnTemplate(datatype) {
        switch(datatype){
        case 1:
        return "numberCellTemplate";
        default:
        return null;
        }
      };

      function initReportSection(section){
        let data = section.data || [];
        let dataProvider = new oj.ArrayDataProvider(data);
        let pageSource = new oj.PagingDataProviderView(dataProvider);
        let colSource = section.fields.map(field => {
        return {
          headerText: field.title,
          field: field.id,
          template: getColumnTemplate(field.dtype)
        };});
        return {
          id: section.id,

          title: section.title,
          desc: section.desc,
          cols: colSource,
          source: pageSource,
          data: section.data,
          dataProvider: dataProvider
        };
      }
      function initReportGroup(group){
        let sections = [];
        group.sections.forEach(section => {
         sections.push(initReportSection(section));
        });
        let selection = ko.observable();

        if (sections.length > 0){
         selection(sections[0].id);
        }
        let sectionProvider = new oj.ArrayDataProvider(sections, {
         keyAttributes: 'id'
        });
        let eventListener = function (event) {
         selection(event.detail.value);
        }
        return {
          id: group.id,
          title: group.title,
          sections: sectionProvider,

          selectedItem: selection,
          selectionChange: eventListener
        };
      }
      function initReportData(report){
        self.attributes.push({id: 'title', title: "Report Type", value: report.title});
        self.attributes.push({id: 'creation', title: "Created", value: report.created});
        self.attributes.push({id: 'dbid', title: "Database ID", value: report.range.dbid});
        self.attributes.push({id: 'beg_snap', title: "Begin Snapshot", value: report.range.beg_snap});
        self.attributes.push({id: 'end_snap', title: "End Snapshot", value: report.range.end_snap});
        report.groups.forEach(group => {
        self.groups.push(initReportGroup(group));
        });

      }
      initReportData(data);
    };

<body class="oj-web-applayout-body">
  <div id="pageContent" class="oj-web-applayout-page">

  <header role="banner" class="oj-web-applayout-header">
    <div class="oj-flex-bar oj-sm-align-items-center">
    <div class="oj-flex-bar-start oj-sm-align-items-baseline">
    <span role="img" class="oj-icon oracle-icon oj-sm-only-hide" title="Oracle">
    </span>
    <h1 class="oj-web-applayout-header-title" title="AWR Report">
Automatic Workload Repository Report
    </h1>
    </div>
    </div>
  </header>
  <div role="main" class="oj-web-applayout-content">
  <div id="container" class="oj-flex">

  <div id="rpt-summ" class="oj-panel oj-sm-12">
    <div id="rpt-header" class="oj-flex">
    <h2 class="oj-header-border oj-sm-12">Database Information</h2>
    </div>
    <div id="rpt-content" class="oj-flex">
    <oj-bind-for-each data='{{attributes}}'>
    <template data-oj-as="attrib">
    <p class="oj-flex-item oj-sm-2">
    <oj-bind-text value="[[attrib.data.title]]">
    </oj-bind-text></p>
    <p class="oj-flex-item oj-sm-10">
    <oj-bind-text value="[[attrib.data.value]]">
    </oj-bind-text></p>

    </template>
    </oj-bind-for-each>
    </div>
  </div>
  <oj-bind-for-each data='{{groups}}'>
  <template data-oj-as="group">
    <div class="oj-panel oj-panel-shadow-sm oj-sm-margin-2x-top oj-sm-12">
    <oj-collapsible expanded="true" data-oj-binding-provider="none">
    <h2 slot="header" class="oj-header-border">
    <oj-bind-text value="[[group.data.title]]">
    </oj-bind-text></h2>
    <div class="oj-flex-item oj-sm-12">
    <oj-bind-for-each data='{{group.data.sections}}'>

    <template data-oj-as="section">
      <div :id="[[section.data.id]]" class="oj-sm-margin-4x-bottom"
           :aria-labelledby="[[section.data.title]]">
      <oj-collapsible expanded="true" data-oj-binding-provider="none">
      <h3 slot="header">
      <oj-bind-text value="[[section.data.title]]"> </oj-bind-text>
      </h3>
      <p><oj-bind-text value="[[section.data.desc]]"></p>
        <oj-table aria-label='{section.data.id}'
        columns-default.sortable='enabled'
        data='[[section.data.source]]'
        columns='[[section.data.cols]]'
        display="grid"

        style="width: 100%;">
        <template slot="numberCellTemplate" data-oj-as="cell">
        <oj-bind-text value="[[formatNum(cell.data)]]"></oj-bind-text>
        </template>
        <oj-paging-control id="paging" data='[[section.data.source]]'
        page-size='5' slot='bottom'>
        </oj-paging-control>
        </oj-table>
        
        <oj-chart 
          type="area"
          orientation="vertical"
          stack="on"
          data="[[section.data.dataProvider]]"
          animation-on-display="auto"
          animation-on-data-change="auto"
          hover-behavior="dim">
          <template slot='itemTemplate' data-oj-as='item'>
            <oj-chart-item 
              value="[[item.data.value]]"
              group-id="[[ [item.data.btime] ]]"
              series-id="[[item.data.metric_name]]">
            </oj-chart-item>
          </template>
        </oj-chart>
        
      </oj-collapsible>
      </div>
    </template>
    </oj-bind-for-each>
    </div>

    </oj-collapsible>
    </div>
  </template>
  </oj-bind-for-each>
  </div>
  </div> <!-- appLayout-content -->
  <footer role="contentinfo" class="oj-web-applayout-footer">
  <div class="oj-web-applayout-footer-item oj-text-secondary-color oj-text-sm">
  Copyright &copy; 2019 Oracle and/or its affiliates. All rights reserved.
  </div>
  </footer>
  </div> <!-- appLayout-page -->
</body>

</html>
